import React, { Component } from "react";
import Form from "react-bootstrap/Form";

class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      message: "",
      disabled: "",
      emailSent: null
    };
  }
  render() {
    return (
      <div>
        <h1>Contact</h1>
      </div>
    );
  }
}

export default Contact;
